import films from '../../assets/films/index';
import series from '../../assets/series/index';

const NavMB = ({ films, series, setMediaType, setMTKey }) => {
    return (
        <ul className='tempMedia'>
            <li onClick={() => { setMediaType({ films }); setMTKey(Object.keys({ films })); }}>Films</li>
            <li onClick={() => { setMediaType({ series }); setMTKey(Object.keys({ series })); }}>Series</li>
        </ul >
    )
};

export default NavMB;
